INSERT INTO `page` VALUES (1,178,'<h2 style=\"text-align: left;\">Prova vÃ¥r nya sÃ¶kfunktion!</h2>\r\n<p>I nya lagrummet.se kan du sÃ¶ka bland annat lagar och fÃ¶rordningar, vÃ¤gledande avgÃ¶randen och fÃ¶reskrifter frÃ¥nÂ en del myndigheter.Â </p>\r\n<p>Dokument som Ã¤nnu inte Ã¤r sÃ¶kbaraÂ direkt frÃ¥n lagrummet.se hittar du via navigeringsmenyn till vÃ¤nster.</p>\r\n<p>PÃ¥ sidan <a href=\"/lagrummet.se//samtliga-rattskallor\" target=\"_blank\">Lista Ã¶ver rÃ¤ttskÃ¤llorna</a> kan du seÂ samtliga kÃ¤llor som ingÃ¥r i rÃ¤ttsinformationssystemet. Du fÃ¥r ocksÃ¥ Ã¶verblick Ã¶ver vilka kÃ¤llor som Ã¤r sÃ¶kbara frÃ¥n lagrummet.se och vilka som Ã¤nnu sÃ¥ lÃ¤nge finns att hÃ¤mta pÃ¥ respektive myndighets webbplats.Â </p>\r\n<p>Â </p>','2011-11-02 16:58:37','VÃ¤lkommen till lagrummet.se   TESTVERSION!','2012-03-28 11:13:52',NULL,0,806,'home','2011-11-02 16:57:00',NULL,'published','Lagrummet.se - startsida',NULL,'frontpage','\0',NULL,12,''),(6,12,'<div>\r\n<p>Lagrummet.se Ã¤r en gemensam webbplats fÃ¶r den offentliga fÃ¶rvaltningens rÃ¤ttsinformation.Â PÃ¥ lagrummet.se hittar du rÃ¤ttsinformation hos</p>\r\n<ul>\r\n<li>regeringen</li>\r\n<li>riksdagen</li>\r\n<li>hÃ¶gre domstolar</li>\r\n<li>statliga myndigheter.</li>\r\n</ul>\r\n<p>Du hittar Ã¤ven en del internationell information.</p>\r\n<p>Varje myndighet ansvarar fÃ¶r innehÃ¥llet i sin egen rÃ¤ttsinformation och hur det publiceras pÃ¥ Internet.</p>\r\n<p>PÃ¥ lagrummet.se fÃ¥r du lÃ¤ra dig hurÂ nya lagar stiftas steg fÃ¶r steg. Du hittar Ã¤venÂ en samling av <a href=\"http://www.lagrummet.se/lar-dig-mer/faq/?id=527\">de vanligaste frÃ¥gorna</a> som kommer tillÂ redaktionen och en <a href=\"http://www.lagrummet.se/lar-dig-mer/ordlista/?id=428\">ordlista</a> som fÃ¶rklarar juridiska begrepp.</p>\r\n<p>Vi tar gÃ¤rna emot synpunkter pÃ¥ sidans utformning.Â Om du har frÃ¥gor om innehÃ¥llet i ett dokument frÃ¥n en myndighet vÃ¤nder du dig direkt till myndigheten.</p>\r\n<p>Kontakta <a href=\"mailto:redaktionen@lagrummet.se\">redaktionen pÃ¥ lagrummet.se</a></p>\r\n<h2>Domstolsverket stÃ¥r bakom lagrummet.se</h2>\r\n<p>Den statliga myndigheten Domstolsverket ansvarar fÃ¶r lagrummet.se. FÃ¶r innehÃ¥llet pÃ¥ de webbplatser lagrummet.se lÃ¤nkar till ansvarar respektive organisation.</p>\r\n</div>','2011-11-04 14:48:17','Om lagrummet.se','2012-03-02 11:14:49',NULL,1200,344,'Om lagrummet.se','2011-11-04 14:47:00',NULL,'published','Om lagrummet.se',NULL,'default','\0',NULL,2,''),(22,3,'<div>\r\n<p>Lagrummet.se is a portal for Swedish public administration legal information. In lagrummet.se you will find legal information from:</p>\r\n<ul>\r\n<li>The Government</li>\r\n<li>Riksdagen (The Swedish Parliament)</li>\r\n<li>Higher courts</li>\r\n<li>Government agencies (approx. 90).</li>\r\n</ul>\r\n<p>You can also find a number of international sources of information. Each agency is responsible for the content of legal information they provide, and how it is published on the Internet. We answer general questions about the portal via e-mail. Questions regarding the content of legal documents are answered directly by the issuing agency. <br />Contact: <a href=\"mailto:redaktionen@lagrummet.se\">redaktionen@lagrummet.se</a></p>\r\n<h2>More information</h2>\r\n<p>On the Swedish Government Offices website you can find a selection of Swedish Code of Statutes (SFS)in translation. As a rule, the translations are not official translations.<br /><a class=\"remotelink\" href=\"http://www.sweden.gov.se/sb/d/3288\">Swedish statutes in translation</a></p>\r\n<p>On the Governments English language website you will find an introduction to the Swedish legal system.<br /><a class=\"remotelink\" href=\"http://www.sweden.gov.se/sb/d/2138\">Introduction to the Swedish legal system</a></p>\r\n<h2>The Swedish National Courts Administration is the publisher of lagrummet.se</h2>\r\n<p>The Swedish National Courts Administration is responsible for the publication of lagrummet.se.</p>\r\n<h2>Development of a system to access Swedish legal information</h2>\r\n<p>The Swedish National Courts Administration determines standards for labelling, structuring and searching for information used by agencies with responsibility for publishing information.</p>\r\n<p>The Swedish National Courts Administration is currently developing a system used for accessing information about the Swedish legal information through the creation of a common standard that will make it possible to refer to, and in a structured manner search for information electronically.</p>\r\n<p>Contact: project manager, <a href=\"mailto:staffan.malmgren@dom.se\">Staffan Malmgren</a>, at The Swedish National Courts Administration.</p>\r\n</div>','2011-11-04 15:18:20','English','2012-02-22 08:47:50',NULL,0,310,'English','2011-11-04 15:17:00',NULL,'published','English',NULL,'english','\0',NULL,1,''),(63,103,'<div>\r\n<p>PÃ¥ den hÃ¤r sidan hittar du lÃ¤nkar till sÃ¶ksidor dÃ¤r du kan hitta lagar och fÃ¶rordningar.</p>\r\n</div>','2011-12-02 17:06:04','Lagar och fÃ¶rordningar','2012-04-10 17:09:13',NULL,33,341,'lagar-och-forordningar','2012-04-10 16:54:00',NULL,'published','Lagar och fÃ¶rordningar',NULL,'legalSource/lagar','\0',NULL,12,''),(71,19,'<div>\r\n<p>PÃ¥ den hÃ¤r sidan hittar du lÃ¤nkar till sÃ¶ksidor dÃ¤r du kan hitta olika typer av fÃ¶rarbeten.</p>\r\n</div>\r\n<div class=\"links\">\r\n<p class=\"linklistintro\"><strong>Regeringen</strong> lÃ¤mnar propositioner (fÃ¶rslag) till riksdagen. Ibland har en kommittÃ© fÃ¶rst fÃ¥tt i uppdrag att utreda frÃ¥gan.</p>\r\n<p><strong>Riksdagen</strong> beslutar om lagar och lagÃ¤ndringar. Innan riksdagen beslutar om en lag behandlas lagfÃ¶rslaget i nÃ¥got av riksdagens utskott.</p>\r\n<p class=\"linklistintro\"><strong>LagrÃ¥dets</strong> uppgift Ã¤r att granska lagfÃ¶rslag nÃ¤r regeringen eller nÃ¥got av riksdagens utskott begÃ¤r det.</p>\r\n</div>','2011-12-02 17:48:26','FÃ¶rarbeten (utredningar, propositioner m.m.)','2012-04-10 17:24:22',NULL,1300,341,'forarbeten','2012-04-10 17:24: