ionen var nummer 133 i ordningen. Riksdagen lÃ¤mnade Ã¤rendet till FÃ¶rsvarsutskottet dÃ¤r det efter behandling blev betÃ¤nkande nummer 9. UtskottsbetÃ¤nkandet gick sedan tillbaka till riksdagen som godkÃ¤nde den nya lagen och sÃ¤nde en kort formell riksdagsskrivelse med nummer 295 till regeringen som dÃ¤refter utfÃ¤rdade lagen.</p>\r\n<p>I propositionen finns vanligen rubriken Ã„rendet och dess beredning. Under den rubriken kan du lÃ¤sa vilken eller vilka utredningar som propositionen bygger pÃ¥.</p>\r\n<p>Det finns inte fÃ¶rarbeten till alla lagar. En ny lag som bara bestÃ¥r av Ã¤ndringar av en tidigare lag har oftast inga fÃ¶rarbeten.</p>\r\n</div>\r\n<div class=\"answer\">\r\n<h3 id=\"vem-beslutar-om-lagar\">Vem beslutar om lagar?</h3>\r\n<p>Riksdagen fÃ¶retrÃ¤der folket och tar beslut om lagar.</p>\r\n</div>','2012-01-03 09:44:51','Vanliga frÃ¥gor','2012-04-12 13:55:26',NULL,3100,412,'vanliga-fragor','2012-02-29 17:06:00',NULL,'published','Vanliga frÃ¥gor',NULL,'faq','\0',NULL,4,''),(188,0,NULL,'2012-01-10 10:05:42','Webbkarta Ã¶ver lagrummet.se','2012-01-10 10:05:42',133,1,NULL,'webbkarta','2011-12-11 14:27:23',NULL,'autoSave','Webbkarta',NULL,'sitemap','\0',NULL,5,''),(226,13,'<p>NÃ¥gra rader fÃ¶rklarande text till vad denna sida visar. Ã–verblick alla rÃ¤ttskÃ¤llorna man nÃ¥r via lagrummet.se. RÃ¤ttskÃ¤llor listade under \"sÃ¶kbara\" kan man sÃ¶ka i lagrummet.se:s sÃ¶kfunktion. Samtliga lÃ¤nkar leder till den sida pÃ¥ ansvarig myndighets sida dÃ¤r rÃ¤ttskÃ¤llan finns.</p>','2012-01-12 16:52:31','Lista Ã¶ver rÃ¤ttskÃ¤llorna','2012-02-20 17:41:13',NULL,1600,341,'samtliga-rattskallor','2012-01-08 16:52:00',NULL,'published','Alla rÃ¤ttskÃ¤llor',NULL,'legalSources','\0',NULL,2,''),(239,28,'<div>\r\n<p>PÃ¥ den hÃ¤r sidan hittar du lÃ¤nkar till myndigheternas fÃ¶reskrifter.</p>\r\n</div>','2012-01-13 09:56:53','Myndigheters fÃ¶reskrifter','2012-04-10 17:14:47',NULL,1299,341,'myndigheters-foreskrifter','2012-04-10 17:02:00',NULL,'published','Myndigheters fÃ¶reskr