rtal till gÃ¤llande <a href=\"#eu-ratt\">EU-rÃ¤tt</a>. PÃ¥ EUR-Lex finns olika databaser dÃ¤r du kan sÃ¶ka bland fÃ¶rdrag, lagstiftning, rÃ¤ttspraxis, parlamentsledamÃ¶ternas frÃ¥gor och Europeiska unionens officiella tidning (EUT).</p>\r\n<p><a class=\"remotelink\" href=\"http://eur-lex.europa.eu/sv/index.htm\">SÃ¶k pÃ¥ EUR-Lex<br /></a></p>\r\n<h2>Europadomstolen <a name=\"E\"></a></h2>\r\n<p>Den europeiska domstolen fÃ¶r de mÃ¤nskliga rÃ¤ttigheterna (Europadomstolen) prÃ¶var Ã¤renden om brott mot den Europeiska konventionen om de mÃ¤nskliga rÃ¤ttigheterna (Europakonventionen). Europakonventionen ska hindra staterna att missbruka sin makt och begÃ¥ Ã¶vergrepp mot de enskilda medborgarna. Sedan 1995 gÃ¤ller Europakonventionen som svensk lag.</p>\r\n<p><a class=\"remotelink\" href=\"http://www.manskligarattigheter.gov.se/extra/pod/?action=pod_show&amp;id=4&amp;module_instance=5&amp;top_id=9&amp;nav_id=4\">LÃ¤s mer om Europadomstolen och Europakonventionen pÃ¥ regeringens webbplats om mÃ¤nskliga rÃ¤ttigheter</a></p>\r\n<p><a href=\"#\">GÃ¥ till sidans topp</a></p>\r\n<h2>Europeiska unionen (EU)<a name=\"E\"></a></h2>\r\n<p>Europeiska unionen (EU) Ã¤r en vidareutveckling av EG-samarbetet. EU bildades den 1 november 1993 nÃ¤r <a href=\"#eu-fordraget\">EU-fÃ¶rdraget</a> bÃ¶rjade gÃ¤lla. EU-fÃ¶rdraget brukar ocksÃ¥ kallas fÃ¶r MaastrichtfÃ¶rdraget eller UnionsfÃ¶rdraget.</p>\r\n<p>EU-kommissionen fÃ¶reslÃ¥r nya lagar. FÃ¶rslagen behandlas av Europaparlamentet och Europeiska unionens rÃ¥d, som ofta kallas ministerrÃ¥det. NÃ¤r nya lagar och regler har antagits Ã¤r det <a href=\"#eu-domstolen_\">EU-domstolens</a> uppgift att tolka dem.</p>\r\n<p><a class=\"remotelink\" href=\"http://www.eu-upplysningen.se\">LÃ¤s mer om EU pÃ¥ EU-upplysningens webbplats</a><br /><a class=\"remotelink\" href=\"http://eur-lex.europa.eu/sv/index.htm\">SÃ¶k pÃ¥ EUR-Lex bland EU:s rÃ¤ttsliga dokument</a></p>\r\n<h2>EU-rÃ¤tt<a name=\"E\"></a></h2>\r\n<p>EU-rÃ¤tt Ã¤r ett samlingsbegrepp fÃ¶r <a href=\"#europeiska_unionen_eu\">EU</a>-medlemslÃ¤ndernas gemensamma regelverk. EU-rÃ¤tten gÃ¤ller fÃ¶re nationell lag. I EU-rÃ¤tten ingÃ¥r</p>\r\n<ul>\r\n<li>de grundlÃ¤ggande <a href=\"#fordrag\">fÃ¶rdragen</a></li>\r\n<li><a href=\"#eu-forordning\">EU-fÃ¶rordningar</a>, <a href=\"#eu-direktiv\">EU-direktiv</a> och andra rÃ¤ttsakter frÃ¥n EU:s institutioner</li>\r\n<li><a href=\"#eu-domstolen_\">EU-domstolens</a> rÃ¤ttspraxis</li>\r\n<li>avtal mellan EU och lÃ¤nder utanfÃ¶r EU.</li>\r\n</ul>\r\n<p><a class=\"remotelink\" href=\"http://www.eu-upplysningen.se/Om-EU/Om-EUs-lagar-och-beslutsfattande/EU-rattsliga-principer/\">LÃ¤s mer om EU-rÃ¤tten pÃ¥ EU-upplysningens webbplats</a></p>\r\n<h2>FramstÃ¤llningar<a name=\"F\"></a></h2>\r\n<p>En framstÃ¤llning Ã¤r ett fÃ¶rslag till <a href=\"#riksdagen\">riksdagen</a> frÃ¥n en av riksdagens myndigheter. FramstÃ¤llningarna behandlas i nÃ¥got av riksdagens <a href=\"#utskott\">utskott</a>, som dÃ¤refter lÃ¤mnar ett fÃ¶rslag till riksdagsbeslut. Exempel pÃ¥ riksdagsmyndigheter Ã¤r</p>\r\n<ul>\r\n<li><a href=\"#justitieombudsmannen_jo\">Riksdagens ombudsmÃ¤n (JustitieombudsmÃ¤nnen, JO)</a></li>\r\n<li>Riksrevisionen</li>\r\n<li>Riksdagsstyrelsen</li>\r\n<li>Riksbanken.</li>\r\n</ul>\r\n<p><a class=\"remotelink\" href=\"http://www.riksdagen.se/sv/Dokument-Lagar/Forslag/Redogorelser-och-framstallningar/\">SÃ¶k bland riksdagsmyndigheternas framstÃ¤llningar<br /></a></p>\r\n<h2>FÃ¶rarbeten<a name=\"F\"></a></h2>\r\n<p>FÃ¶rarbeten Ã¤r bland annat de <a href=\"#utredningsbetankande\">utredningsbetÃ¤nkanden</a>, <a href=\"#proposition\">propositioner</a> och <a href=\"#utskott\">utskottsbetÃ¤nkanden</a> som tas fram innan riksdagen beslutar om en ny lag. FÃ¶rarbetena ger tillsammans en utfÃ¶rlig bakgrund till lagens tillkomst.</p>\r\n<p>Det finns inte fÃ¶rarbeten till alla lagar. En ny <a href=\"#lag\">lag</a> som bara bestÃ¥r av Ã¤ndringar av en tidigare lag har oftast inga fÃ¶rarbeten.</p>\r\n<p>FÃ¶rdrag<a name=\"F\"></a></p>\r\n<div>\r\n<p>Ett fÃ¶rdrag Ã¤r ett avtal mellan <a href=\"#europeiska_unionen_eu\">EU</a>-medlemslÃ¤ndernas regeringar. Ett fÃ¶rdrag innehÃ¥ller grundlÃ¤ggande regler som utgÃ¶r ramarna fÃ¶r mer detaljerade gemensamma regler. SÃ¥dana detaljerade regler utarbetas inom EU-samarbetet i form av bland annat <a href=\"#eu-direktiv\">EU-direktiv</a> och <a href=\"#eu-forordning\">EU-fÃ¶rordningar</a>.</p>\r\n</div>\r\n<p><a href=\"#\">GÃ¥ till sidans topp</a></p>\r\n<h2>FÃ¶rfattning<a name=\"F\"></a></h2>\r\n<p>FÃ¶rfattning Ã¤r en samlande beteckning fÃ¶r <a href=\"#lag\">lagar</a>, <a href=\"#forordning\">fÃ¶rordningar</a> och <a href=\"#myndighetsforeskrift\">myndighetsfÃ¶reskrifter</a>.</p>\r\n<h2>FÃ¶rfattningar i fulltext<a name=\"F\"></a></h2>\r\n<p><a href=\"#regeringskansliet\">Regeringskansliets</a> databas FÃ¶rfattningar i fulltext innehÃ¥ller versioner av <a href=\"#lag\">lagar</a> och <a href=\"#forordning\">fÃ¶rordningar</a> dÃ¤r alla <a href=\"#andringsforfattning\">Ã¤ndringsfÃ¶rfattningar</a> Ã¤r inlagda pÃ¥ rÃ¤tt plats i <a href=\"#grundforfattning\">grundfÃ¶rfattningen</a>. Denna text brukar kallas fÃ¶r en konsoliderad version av fÃ¶rfattningen och utgÃ¶r den senaste gÃ¤llande versionen av fÃ¶rfattningstexten.</p>\r\n<p><a class=\"remotelink\" href=\"http://62.95.69.15/sfs/sfst_form2.html\">SÃ¶k i FÃ¶rfattningar i fulltext <br /></a></p>\r\n<h2>FÃ¶rfattningssamling<a name=\"F\"></a></h2>\r\n<p><a href=\"#forfattning\">FÃ¶rfattningar</a> publiceras i flera olika serier. Den viktigaste Ã¤r <a href=\"#svensk_forfattningssamling_sfs\">Svensk fÃ¶rfattningssamling (SFS)</a> som ges ut av <a href=\"#regeringskansliet\">Regeringskansliet</a>. I SFS publiceras alla <a href=\"#lag\">lagar</a> som <a href=\"#riksdagen\">riksdagen</a> beslutar och alla <a href=\"#forordning\">fÃ¶rordningar</a> som <a href=\"#regeringen\">regeringen</a> beslutar.</p>\r\n<p>Statliga myndigheter som till exempel SjÃ¶fartsverket, Riksarkivet och NaturvÃ¥rdsverket har sina egna fÃ¶rfattningssamlingar.</p>\r\n<h2>FÃ¶rordning<a name=\"F\"></a></h2>\r\n<p>Enligt svenska fÃ¶rhÃ¥llanden Ã¤r fÃ¶rordningar regler som <a href=\"#regeringen\">regeringen</a> beslutar utan <a href=\"#riksdagen\">riksdagens</a> medverkan. FÃ¶rordningar kan till exempel reglera de statliga <a href=\"#myndighet\">myndigheternas</a> arbete. I allmÃ¤nhet innehÃ¥ller inte fÃ¶rordningar regler som direkt berÃ¶r dig som medborgare. SÃ¥dana regler krÃ¤ver i stÃ¤llet att riksdagen beslutar om en <a href=\"#lag\">lag</a>. Alla fÃ¶rordningar publiceras i <a href=\"#svensk_forfattningssamling_sfs\">Svensk fÃ¶rfattningssamling (SFS)</a>.</p>\r\n<p>I <a href=\"#europeiska_unionen_eu\">EU</a>-sammanhang Ã¤r en fÃ¶rordning ett rÃ¤ttsligt dokument inom <a href=\"#eu-ratt\">EU-rÃ¤tten</a>. En EU-fÃ¶rordning gÃ¤ller alla EU:s medlemslÃ¤nder, de fÃ¶retag och myndigheter som Ã¤r verksamma i lÃ¤nderna samt lÃ¤ndernas medborgare. EU-fÃ¶rordningar har samma verkan som <a href=\"#lag\">lagar</a> och gÃ¤ller i medlemslÃ¤nderna precis som de Ã¤r skrivna. Det betyder att de inte fÃ¥r omarbetas eller justeras med hÃ¤nsyn till medlemslÃ¤ndernas egna fÃ¶rhÃ¥llanden.</p>\r\n<h2>FÃ¶rordningsmotiv<a name=\"F\"></a></h2>\r\n<p>NÃ¤r <a href=\"#regeringen\">regeringen</a> vill fÃ¶rklara nya regler i en viss <a href=\"#fÃ¶rordning\">fÃ¶rordning</a> och ge besked om hur fÃ¶rordningen ska tolkas och tillÃ¤mpas skriver regeringen ett fÃ¶rordningsmotiv. I fÃ¶rordningsmotivet fÃ¶rklarar regeringen ibland ocksÃ¥ orsakerna till varfÃ¶r fÃ¶rordningen har kommit till. Om det finns ett fÃ¶rordningsmotiv brukar det anges i en fotnot i fÃ¶rordningen.</p>\r\n<p>Ett fÃ¶rordningsmotiv kan delvis jÃ¤mfÃ¶ras med en <a href=\"#proposition\">proposition</a> som Ã¤r ett motsvarande dokument nÃ¤r regeringen lÃ¤mnar ett fÃ¶rslag om en ny lag till <a href=\"#riksdagen\">riksdagen</a>.</p>\r\n<p><a class=\"remotelink\" href=\"http://62.95.69.23/\">SÃ¶k bland fÃ¶rordningsmotiven</a></p>\r\n<p><a href=\"#\">GÃ¥ till sidans topp</a></p>\r\n<h2>FÃ¶rtursfÃ¶rklaring<a name=\"F\"></a></h2>\r\n<p>Om du anser att en domstol tar fÃ¶r lÃ¥ng tid pÃ¥ sig att behandla ett mÃ¥l eller Ã¤rende kan du som Ã¤r part i mÃ¥let begÃ¤ra en fÃ¶rtursfÃ¶rklaring. DÃ¥ gÃ¶r domstolen en bedÃ¶mning om ditt mÃ¥l ska prioriteras framfÃ¶r andra mÃ¥l i domstolen. <br /><a class=\"remotelink\" href=\"http://www.domstol.se/templates/DV_InfoPage.aspx?id=16097\">Se sammanstÃ¤llning av beslut om fÃ¶rtursfÃ¶rklaring</a></p>\r\n<h2>GrundfÃ¶rfattning<a name=\"G\"></a></h2>\r\n<p>NÃ¤r en ny <a href=\"#forfattning\">fÃ¶rfattning</a> ges ut fÃ¶r fÃ¶rsta gÃ¥ngen brukar man kalla den fÃ¶r en grundfÃ¶rfattning. En fÃ¶rfattning som Ã¤ndrar en tidigare utgiven fÃ¶rfattning kallas fÃ¶r <a href=\"#andringsforfattning\">Ã¤ndringsfÃ¶rfattning</a>. BÃ¥da fÃ¶rfattningarna fÃ¥r ett unikt lÃ¶pnummer i <a href=\"#svensk_forfattningssamling_sfs\">Svensk fÃ¶rfattningssamling (SFS)</a>, till exempel lag (2003:307) om fÃ¶rbud mot diskriminering respektive lag (2006:69) om Ã¤ndring i lagen (2003:307) om fÃ¶rbud mot diskriminering. Alla grund- och Ã¤ndringsfÃ¶rfattningar publiceras i <a href=\"#regeringskansliet\">Regeringskansliets</a> databas Svensk fÃ¶rfattningssamling i tryckt format.</p>\r\n<p><a class=\"remotelink\" href=\"http://62.95.69.3/\">SÃ¶k i SFS i tryckt format<br /></a></p>\r\n<h2>Grundlag<a name=\"G\"></a></h2>\r\n<p>En grundlag Ã¤r en sÃ¤rskild form av <a href=\"#lag\">lag</a> som stÃ¥r Ã¶ver alla andra lagar. InnehÃ¥llet i andra lagar fÃ¥r aldrig strida mot vad som stÃ¥r i en grundlag.<br /><br />Grundlagarna Ã¤r svÃ¥rare att Ã¤ndra Ã¤n andra lagar. En vanlig lag kan Ã¤ndras genom ett beslut i <a href=\"#riksdagen\">riksdagen</a>, men fÃ¶r att Ã¤ndra en grundlag mÃ¥ste riksdagen fatta tvÃ¥ likadana beslut och dessutom mÃ¥ste ett allmÃ¤nt riksdagsval ha genomfÃ¶rts mellan de tvÃ¥ besluten. Anledningen till att grundlagarna Ã¤r svÃ¥ra att Ã¤ndra Ã¤r att de utgÃ¶r grunden fÃ¶r demokratin. Riksdagen ska inte kunna fatta fÃ¶rhastade beslut som inskrÃ¤nker mÃ¤nniskors grundlÃ¤ggande fri- och rÃ¤ttigheter.</p>\r\n<p>Sverige har fyra grundlagar</p>\r\n<ul>\r\n<li><a href=\"#regeringsformen_rf\">Regeringsformen</a> frÃ¥n 1974</li>\r\n<li><a href=\"#successionsordningen_so\">Successionsordningen</a> frÃ¥n 1810</li>\r\n<li><a href=\"#tryckfrihetsforordningen_tf\">TryckfrihetsfÃ¶rordningen</a> frÃ¥n 1949</li>\r\n<li><a href=\"#yttrandefrihetsgrundlagen_ygl\">Yttrandefrihetsgrundlagen</a> frÃ¥n 1991.</li>\r\n</ul>\r\n<h2>HÃ¶gsta fÃ¶rvaltningsdomstolens Ã¥rsbok (HFD)<a name=\"H\"></a></h2>\r\n<p>HÃ¶gsta fÃ¶rvaltningsdomstolens Ã¥rsbok (HFD) Ã¤r en tryckt publikation dÃ¤r du hittar referat av HÃ¶gsta fÃ¶rvaltningsdomstolens viktigare mÃ¥l. HÃ¶gsta fÃ¶rvaltningsdomstolen hette fram till Ã¥rsskiftet 2010/2011 RegeringsrÃ¤tten och Ã¥rsboken kallades dÃ¥ <a href=\"#regeringsrattens_arsbok_ra\">RegeringsrÃ¤ttens Ã¥rsbok (RÃ…)</a>.</p>\r\n<p>I den juridiska litteraturen Ã¤r det vanligt att man hÃ¤nvisar till ett speciellt rÃ¤ttsfall med hjÃ¤lp av var det finns refererat i HFD eller i RÃ…. HFD 2011 ref. 4 betyder till exempel att referatet finns i 2011 Ã¥rs utgÃ¥va och att det kommer som nummer 4 i ordningen. RÃ… 2006 ref. 32 betyder att referatet finns i 2006 Ã¥rs utgÃ¥va och att det kommer som nummer 32 i ordningen. I Domstolsverkets databas fÃ¶r rÃ¤ttsfall kan du hitta referat av HÃ¶gsta fÃ¶rvaltningsdomstolens viktigare mÃ¥l frÃ¥n och med 1993 och framÃ¥t med hjÃ¤lp av referensen frÃ¥n HFD eller RÃ…. <br /><a class=\"remotelink\" href=\"http://www.rattsinfosok.dom.se/lagrummet/index.jsp\">SÃ¶k bland HÃ¶gsta fÃ¶rvaltningsdomstolens domar hos Domstolsverket</a></p>\r\n<h2>JustitieombudsmÃ¤nnen (JO)<a name=\"J\"></a></h2>\r\n<p>JustitieombudsmÃ¤nnen (JO) Ã¤r en myndighet under <a href=\"#riksdagen\">riksdagen</a>. Det officiella namnet Ã¤r Riksdagens ombudsmÃ¤n. JO kontrollerar att myndigheterna behandlar dig och andra medborgare enligt <a href=\"#lag\">lagen</a>. Hos JO kan du klaga om du anser att du eller nÃ¥gon annan har blivit felaktigt behandlad av en <a href=\"#myndighet\">myndighet</a> eller en tjÃ¤nsteman vid en myndighet.</p>\r\n<p><a class=\"remotelink\" href=\"http://www.jo.se/\">Riksdagens ombudsmÃ¤n (JO)</a></p>\r\n<p class=\"gototoplink\"><a href=\"#\">GÃ¥ till sidans topp</a></p>\r\n<h2>KommittÃ©<a name=\"K\"></a></h2>\r\n<p>NÃ¤r <a href=\"#regeringen\">regeringen</a> arbetar med en frÃ¥ga som Ã¤r extra svÃ¥r att lÃ¶sa krÃ¤vs en grundlig genomgÃ¥ng innan regeringen lÃ¤mnar en <a href=\"#proposition\">proposition</a> till <a href=\"#riksdagen\">riksdagen</a>. DÃ¥ kan regeringen tillsÃ¤tta en kommittÃ© som ska utreda frÃ¥gan och komma med fÃ¶rslag till lÃ¶sning. I <a href=\"#kommittedirektiv\">kommittÃ©direktiven</a> anger regeringen vad den vill att kommittÃ©n ska utreda. En kommittÃ© kan bestÃ¥ av experter, tjÃ¤nstemÃ¤n och politiker.</p>\r\n<h2>KommittÃ©berÃ¤ttelsen<a name=\"K\"></a></h2>\r\n<p>KommittÃ©berÃ¤ttelsen Ã¤r en rapport som <a href=\"#regeringen\">regeringen</a> ger ut en gÃ¥ng om Ã¥ret. I den kan du lÃ¤sa vilka <a href=\"#kommitte\">kommittÃ©er</a> som har arbetat Ã¥t regeringen under Ã¥ret, vilka som har varit med i dem och vilka <a href=\"#betankande\">betÃ¤nkanden</a> som de har publicerat.</p>\r\n<p><a class=\"remotelink\" href=\"http://62.95.69.15/komm/komm_form2.html\">SÃ¶k i kommittÃ©berÃ¤ttelsen</a></p>\r\n<h2>KommittÃ©direktiv<a name=\"K\"></a></h2>\r\n<p>NÃ¤r <a href=\"#regeringen\">regeringen</a> utser en <a href=\"#kommitte\">kommittÃ©</a> fÃ¥r den i uppdrag att utreda en viss frÃ¥ga. Regeringen anger riktlinjerna fÃ¶r arbetet i ett kommittÃ©direktiv. Direktivet talar bland annat om vilken frÃ¥ga som ska utredas, vilka problem som Ã¤r viktiga att ta hÃ¤nsyn till och nÃ¤r utredningen ska vara fÃ¤rdig.</p>\r\n<p><a class=\"remotelink\" href=\"http://62.95.69.15/dir/dir_form2.html\">SÃ¶k bland kommittÃ©direktiven</a></p>\r\n<h2>Konsolidering<a name=\"K\"></a></h2>\r\n<p>NÃ¤r en <a href=\"#forfattning\">fÃ¶rfattning</a> har funnits ett tag brukar alla Ã¤ndringar gÃ¶ra det svÃ¥rt att se vilken text som gÃ¤ller. MÃ¥nga <a href=\"#myndighet\">myndigheter</a> brukar dÃ¥ sammanstÃ¤lla en version av texten dÃ¤r alla <a href=\"#andringsforfattning\">Ã¤ndringsfÃ¶rfattningar</a> Ã¤r inlagda pÃ¥ rÃ¤tt plats i <a href=\"#grundforfattning\">grundfÃ¶rfattningen</a>. Denna text brukar kallas fÃ¶r en konsoliderad version av fÃ¶rfattningen. <a href=\"#regeringskansliet\">Regeringskansliet</a> har en databas fÃ¶r dessa versioner av <a href=\"#lag\">lagar</a> och <a href=\"#forordning\">fÃ¶rordningar</a>. Databasen kallas fÃ¶r <a href=\"#forfattningar_i_fulltext\">FÃ¶rfattningar i fulltext</a>. En myndighet kan ocksÃ¥ vÃ¤lja att trycka den konsoliderade versionen och ge ut den pÃ¥ nytt. Detta brukar anges i fÃ¶rfattningen med ordet <a href=\"#omtryck\">omtryck</a>.</p>\r\n<h2>Konstitution<a name=\"K\"></a></h2>\r\n<p>Konstitution Ã¤r ett lands <a href=\"#grundlag\">grundlagar</a>.</p>\r\n<p class=\"gototoplink\"><a href=\"#\">GÃ¥ till sidans topp</a></p>\r\n<h2>KungÃ¶relse<a name=\"K\"></a></h2>\r\n<p>KungÃ¶relse Ã¤r ett offentliggÃ¶rande till allmÃ¤nheten av nÃ¥got som man vill att allmÃ¤nheten ska rÃ¤tta sig efter.</p>\r\n<p>I lagrummet.se finns det en lÃ¤nk till <a href=\"#regeringskansliet\">Regeringskansliets</a> databas <a href=\"#svensk_forfattningssamling_sfs\">Svensk fÃ¶rfattningssamling</a> i tryckt format. I den presenteras <a href=\"#forfattning\">fÃ¶rfattningarna</a> som de ser ut nÃ¤r de ges ut.</p>\r\n<p><a class=\"remotelink\" href=\"http://62.95.69.3/\">SÃ¶k i SFS i tryckt format</a></p>\r\n<h2>Lag<a name=\"L\"></a></h2>\r\n<p>Lagar Ã¤r regler som alla i ett land mÃ¥ste fÃ¶lja. NÃ¤r riksdagen har beslutat om en lag kan den bara Ã¤ndras eller upphÃ¤vas genom att <a href=\"#riksdagen\">riksdagen</a> beslutar om en ny lag.</p>\r\n<p><a href=\"#regeringen\">Regeringen</a> kan ocksÃ¥ besluta om regler. SÃ¥dana regler kallas <a href=\"#forordning\">fÃ¶rordningar</a>. I <a href=\"#regeringsformen_rf\">regeringsformen</a>, som Ã¤r en av vÃ¥ra <a href=\"#grundlag\">grundlagar</a>, stÃ¥r det vad som mÃ¥ste bestÃ¤mmas genom en lag och vad som kan bestÃ¤mmas genom en fÃ¶rordning. Alla lagar och fÃ¶rordningar publiceras i <a href=\"#svensk_forfattningssamling_sfs\">Svensk fÃ¶rfattningssamling (SFS)</a>.</p>\r\n<p>En del av lagstiftningen som rÃ¶r Sverige beslutas gemensamt inom <a href=\"#europeiska_unionen_eu\">Europeiska unionen (EU)</a>.</p>\r\n<h2>LagrÃ¥det<a name=\"L\"></a></h2>\r\n<p>LagrÃ¥dets uppgift Ã¤r att granska ett <a href=\"#lag\">lag</a>fÃ¶rslag nÃ¤r <a href=\"#regeringen\">regeringen</a> eller ett av <a href=\"#riksdagen\">riksdagens</a> <a href=\"#utskott\">utskott</a> begÃ¤r det. Syftet med granskningen Ã¤r bland annat att lagfÃ¶rslaget inte ska stÃ¥ i konflikt med andra lagar och bestÃ¤mmelser. Regeringen lÃ¤mnar alla viktigare lagfÃ¶rslag till LagrÃ¥det fÃ¶r granskning. NÃ¤r regeringen sedan lÃ¤mnar en <a href=\"#proposition\">proposition</a> till riksdagen finns LagrÃ¥dets granskning med i propositionen. LagrÃ¥det bestÃ¥r huvudsakligen av domare frÃ¥n hÃ¶gre domstolar.</p>\r\n<p><a class=\"remotelink\" href=\"http://www.lagradet.se/\">LÃ¤s mer pÃ¥ LagrÃ¥dets webbplats</a></p>\r\n<h2>LagrÃ¥dsremiss<a name=\"L\"></a></h2>\r\n<p>En lagrÃ¥dsremiss Ã¤r ett lagfÃ¶rslag som <a href=\"#regeringen\">regeringen</a> eller ett <a href=\"#utskott\">utskott</a> i <a href=\"#riksdagen\">riksdagen</a> skickar till <a href=\"#lagradet\">LagrÃ¥det</a> fÃ¶r granskning.</p>\r\n<h2>Motion<a name=\"M\"></a></h2>\r\n<p>RiksdagsledamÃ¶terna kan lÃ¤mna fÃ¶rslag till <a href=\"#riksdagen\">riksdagen</a> genom motioner. Det kan vara en eller flera ledamÃ¶ter som stÃ¥r bakom en motion. RiksdagsledamÃ¶terna ska lÃ¤mna motionerna efter att <a href=\"#regeringen\">regeringen</a> har lÃ¤mnat sin <a href=\"#proposition\">proposition</a> och de ska handla om samma saker som propositionen. En motion Ã¤r dÃ¤rfÃ¶r oftast ett motfÃ¶rslag till ett fÃ¶rslag frÃ¥n regeringen.</p>\r\n<p>RiksdagsledamÃ¶terna kan ocksÃ¥ lÃ¤mna motioner utan att det finns nÃ¥gon proposition att ta stÃ¤llning till. SÃ¥dana motioner kallas fristÃ¥ende. FristÃ¥ende motioner kan bara lÃ¤mnas under den allmÃ¤nna motionstiden (2-3 veckor i septemberâ€“oktober) eller nÃ¤r det har intrÃ¤ffat en viktig hÃ¤ndelse.</p>\r\n<p class=\"gototoplink\"><a href=\"#\">GÃ¥ till sidans topp</a></p>\r\n<h2 id=\"myndighet\">Myndighet</h2>\r\n<p>En myndighet Ã¤r ett statligt organ som ansvarar fÃ¶r den lÃ¶pande verksamheten inom statsfÃ¶rvaltningen, till exempel Skatteverket, FÃ¶rsÃ¤kringskassan och Socialstyrelsen. <a href=\"#regeringen\">Regeringen</a> bestÃ¤mmer mÃ¥l och riktlinjer och fÃ¶rdelar pengar till myndigheternas verksamhet genom Ã¥rliga <a href=\"#regleringsbrev\">regleringsbrev</a>. Regeringen fÃ¥r dock inte lÃ¤gga sig i hur myndigheterna ska tillÃ¤mpa en viss <a href=\"#lag\">lag</a> eller hur de ska besluta i olika Ã¤renden.</p>\r\n<h2 id=\"myndighetsforeskrift\">MyndighetsfÃ¶reskrift<a name=\"M\"></a></h2>\r\n<p><a href=\"#riksdagen\">Riksdag</a> och <a href=\"#regeringen\">regering</a> har gett (bemyndigat) vissa statliga <a href=\"#myndighet\">myndigheter</a> rÃ¤tt att besluta om fÃ¶reskrifter inom sitt verksamhetsomrÃ¥de. MyndighetsfÃ¶reskrifterna publiceras i den <a href=\"#forfattningssamling\">fÃ¶rfattningssamling</a> som hÃ¶r till myndigheten.</p>\r\n<h2>Notis<a name=\"N\"></a></h2>\r\n<p>Ibland <a href=\"#kungorelse\">kungÃ¶rs</a> en fÃ¶rfattning som en <a href=\"#myndighet\">myndighet</a> har beslutat i en annan myndighets <a href=\"#forfattningssamling\">fÃ¶rfattningssamling</a>. Myndigheten som stÃ¥r bakom fÃ¶rfattningen ska dÃ¥ fÃ¶ra in en notis i sin egen fÃ¶rfattningssamling. Notisen hÃ¤nvisar till den ansvariga myndighetens fÃ¶rfattningssamling och talar om vilken beteckning fÃ¶rfattningen har hos den myndigheten.</p>\r\n<h2>NÃ¥diga luntan<a name=\"N\"></a></h2>\r\n<p>NÃ¥diga luntan Ã¤r ett annat namn pÃ¥ <a href=\"#budgetpropositionen\">budgetpropositionen</a>.</p>\r\n<h2>Omtryck<a name=\"O\"></a></h2>\r\n<p>NÃ¤r en <a href=\"#forfattning\">fÃ¶rfattning</a> har blivit svÃ¥rÃ¶verskÃ¥dlig pÃ¥ grund av ett stort antal Ã¤ndringar brukar <a href=\"#grundforfattning\">grundfÃ¶rfattningen</a> och alla <a href=\"#andringsforfattning\">Ã¤ndringsfÃ¶rfattningar</a> som hÃ¶r till den slÃ¥s samman till en ny â€“ <a href=\"#konsolidering\">konsoliderad</a> â€“ version och ges ut pÃ¥ nytt. Detta kallas fÃ¶r ett omtryck av fÃ¶rfattningen. PÃ¥ fÃ¶rfattningens fÃ¶rsta sida anges att det handlar om ett omtryck.</p>\r\n<p class=\"gototoplink\"><a href=\"#\">GÃ¥ till sidans topp</a></p>\r\n<h2>Praxis <a name=\"P\"></a></h2>\r\n<p>Se <a href=\"#rattspraxis\">rÃ¤ttspraxis</a></p>\r\n<h2>Prejudikat <a name=\"P\"></a></h2>\r\n<p>Se <a href=\"#rattspraxis\">rÃ¤ttspraxis</a></p>\r\n<h2>Proposition<a name=\"P\"></a></h2>\r\n<p>En proposition Ã¤r ett fÃ¶rslag frÃ¥n <a href=\"#regeringen\">regeringen</a> till <a href=\"#riksdagen\">riksdagen</a>. En proposition kan innehÃ¥lla fÃ¶rslag till</p>\r\n<ul>\r\n<li>nya <a href=\"#lag\">lagar</a></li>\r\n<li>Ã¤ndringar av lagar</li>\r\n<li>nya riktlinjer.</li>\r\n</ul>\r\n<h2>Protokoll<a name=\"P\"></a></h2>\r\n<p>Debatter, beslut och annat som diskuteras i <a href=\"#riksdagen\">riksdagen</a> framgÃ¥r av riksdagens protokoll. Ett snabbprotokoll finns redan dagen efter i bÃ¥de tryckt och elektronisk form. Det slutliga protokollet Ã¤r fÃ¤rdigt efter nÃ¥gra veckor.</p>\r\n<p><a class=\"remotelink\" href=\"http://www.riksdagen.se/sv/Dokument-Lagar/Kammaren/Protokoll/\">SÃ¶k bland riksdagens protokoll</a></p>\r\n<h2>RedogÃ¶relse<a name=\"R\"></a></h2>\r\n<p><a href=\"#riksdagen\">Riksdagens</a> myndigheter lÃ¤mnar in redogÃ¶relser Ã¶ver Ã¥rets verksamhet till riksdagen. RedogÃ¶relserna behandlas i nÃ¥got av riksdagens utskott. Exempel pÃ¥ riksdagsmyndigheter Ã¤r</p>\r\n<ul>\r\n<li><a href=\"#riksdagens_ombudsman_\">Riksdagens ombudsmÃ¤n (JustitieombudsmÃ¤nnen, JO)</a></li>\r\n<li>Riksrevisionen</li>\r\n<li>Riksdagsstyrelsen</li>\r\n<li>Riksbanken.</li>\r\n</ul>\r\n<p><a class=\"remotelink\" href=\"http://www.riksdagen.se/sv/Dokument-Lagar/Forslag/Redogorelser-och-framstallningar/\">SÃ¶k bland riksdagsmyndigheternas redogÃ¶relser</a></p>\r\n<p class=\"gototoplink\"><a href=\"#\">GÃ¥ till sidans topp</a></p>\r\n<h2 id=\"regeringen\">Regeringen<a name=\"R\"></a></h2>\r\n<p>I <a href=\"#regeringsformen_rf\">regeringsformen</a> stÃ¥r det att regeringen styr riket. Det innebÃ¤r att regeringen lÃ¤mnar fÃ¶rslag (<a href=\"#proposition\">propositioner</a>) till <a href=\"#riksdagen\">riksdagen</a> och ser till sÃ¥ att de beslut som riksdagen tar genomfÃ¶rs. Regeringen Ã¤r ansvarig infÃ¶r riksdagen och den mÃ¥ste ha riksdagens stÃ¶d, annars kan den tvingas att avgÃ¥. Riksdagen kan nÃ¤r som helst prÃ¶va om regeringen har stÃ¶d av riksdagen.<br /><br />Statsministern Ã¤r regeringens chef. Statsministern utser de statsrÃ¥d som ska ingÃ¥ i regeringen och bestÃ¤mmer ocksÃ¥ vilka av statsrÃ¥den som ska vara ministrar. Regeringens arbete sker i de olika departementen och det Ã¤r de statliga <a href=\"#myndighet\">myndigheterna</a> som utfÃ¶r besluten.<br /><br />Regeringen representerar Sverige i Europeiska rÃ¥det och Europeiska unionens rÃ¥d, som ofta kallas ministerrÃ¥det. Regeringen Ã¤r ansvarig infÃ¶r riksdagen ocksÃ¥ nÃ¤r det gÃ¤ller EU-frÃ¥gor.</p>\r\n<p><a class=\"remotelink\" href=\"http://www.regeringen.se/sb/d/1488\">LÃ¤s mer pÃ¥ regeringens webbplats <br /></a></p>\r\n<h2>Regeringsformen (RF)<a name=\"R\"></a></h2>\r\n<p>Regeringsformen (RF) Ã¤r en av Sveriges fyra <a href=\"#grundlag\">grundlagar</a>. Regeringsformen innehÃ¥ller de grundlÃ¤ggande principerna fÃ¶r det svenska statsskicket: hur Sverige ska styras, hur de hÃ¶gsta statsorganen ska organiseras och hur deras verksamhet ska bedrivas.</p>\r\n<h2>Regeringskansliet<a name=\"R\"></a></h2>\r\n<p><a href=\"#regeringen\">Regeringen</a> styr Sverige. Till sin hjÃ¤lp i arbetet har regeringen Regeringskansliet. Regeringskansliet Ã¤r en <a href=\"#myndighet\">myndighet</a> som bestÃ¥r av StatsrÃ¥dsberedningen, de elva fackdepartementen och FÃ¶rvaltningsavdelningen. Till Regeringskansliet hÃ¶r Ã¤ven ambassader, konsulat, representationer och delegationer vid bland annat FN, <a href=\"#europeiska_unionen_eu\">EU</a> och OECD.</p>\r\n<p><a class=\"remotelink\" href=\"http://www.regeringen.se/\">LÃ¤s mer om Regeringskansliet pÃ¥ regeringens webbplats </a></p>\r\n<h2>RegeringsrÃ¤ttens Ã¥rsbok (RÃ…)<a name=\"R\"></a></h2>\r\n<p>RegeringsrÃ¤ttens Ã¥rsbok (RÃ…) Ã¤r en tryckt publikation dÃ¤r du hittar referat av RegeringsrÃ¤ttens viktigare mÃ¥l. RegeringsrÃ¤tten bytte vid Ã¥rsskiftet 2010/2011 namn till HÃ¶gsta fÃ¶rvaltningsdomstolen. FrÃ¥n och med 2011 kallas Ã¥rsboken <a href=\"#hogsta_forvaltningsdomstolens_arsbok_hfd\">HÃ¶gsta fÃ¶rvaltningsdomstolens Ã¥rsbok (HFD)</a>.</p>\r\n<p><a class=\"remotelink\" href=\"http://www.rattsinfosok.dom.se/lagrummet/index.jsp\">SÃ¶k bland HÃ¶gsta fÃ¶rvaltningsdomstolens domar hos Domstolsverket<br /></a></p>\r\n<h2>Regleringsbrev<a name=\"R\"></a></h2>\r\n<p>Regeringen styr de statliga <a href=\"#myndighet\">myndigheterna</a> genom Ã¥rliga regleringsbrev. Ett regleringsbrev talar om vilka mÃ¥l myndigheten ska uppnÃ¥ med sin verksamhet och hur mycket pengar den fÃ¥r till sitt fÃ¶rfogande. Ekonomistyrningsverkets databas <a href=\"#statsliggaren\">Statsliggaren</a> innehÃ¥ller samtliga aktuella regleringsbrev.</p>\r\n<p><a class=\"remotelink\" href=\"http://www.esv.se/Verktyg--stod/Statsliggaren/\">SÃ¶k bland regleringsbreven i Statsliggaren</a></p>\r\n<p class=\"gototoplink\"><a href=\"#\">GÃ¥ till sidans topp</a></p>\r\n<h2>Riksdagen<a name=\"R\"></a></h2>\r\n<p>Riksdagen vÃ¤ljs av folket genom allmÃ¤nna val vart fjÃ¤rde Ã¥r. Riksdagen bestÃ¥r av 349 ledamÃ¶ter och Ã¤r indelad i 15 <a href=\"#utskott\">utskott</a>.</p>\r\n<p>Riksdagens stiftar <a href=\"#lag\">lagar</a>, beslutar om skatter och bestÃ¤mmer statens utgifter och inkomster i statsbudgeten. Riksdagen kontrollerar ocksÃ¥ hur <a href=\"#regeringen\">regeringen</a> och de statliga <a href=\"#myndighet\">myndigheterna</a> skÃ¶ter sitt arbete. Dessutom har riksdagen stort inflytande pÃ¥ utrikespolitiken och <a href=\"#europeiska_unionen_eu\">EU</a>-frÃ¥gorna.</p>\r\n<p><a class=\"remotelink\" href=\"http://www.riksdagen.se\">LÃ¤s mer pÃ¥ riksdagens webbplats <br /></a></p>\r\n<h2>Riksdagens ombudsmÃ¤n <a name=\"R\"></a></h2>\r\n<p>Se <a href=\"#justitieombudsmannen_JO\">JustitieombudsmÃ¤nnen (JO)</a></p>\r\n<h2>Riksdagsordningen (RO)<a name=\"R\"></a></h2>\r\n<p>I riksdagsordningen (RO) finns detaljerade bestÃ¤mmelser om <a href=\"#riksdagen\">riksdagen</a> och dess arbetsformer. Riksdagsordningen Ã¤r ett mellanting mellan en <a href=\"#grundlag\">grundlag</a> och en vanlig <a href=\"#lag\">lag</a>. FÃ¶r att Ã¤ndra den krÃ¤vs endast ett riksdagsbeslut men det mÃ¥ste fattas med kvalificerad majoritet (minst tre fjÃ¤rdedelar av de rÃ¶stande och mer Ã¤n hÃ¤lften av ledamÃ¶terna).</p>\r\n<h2>Riksdagsskrivelse<a name=\"R\"></a></h2>\r\n<p>Se <a href=\"#skrivelse\">skrivelse</a></p>\r\n<h2>Riksdagstrycket<a name=\"R\"></a></h2>\r\n<p>Riksdagstrycket Ã¤r en sammanfattande benÃ¤mning pÃ¥ vissa dokument som <a href=\"#riksdagen\">riksdagen</a> ger ut i bÃ¥de tryckt och elektronisk form. Till riksdagstrycket hÃ¶r <a href=\"#protokoll\">protokoll</a>, <a href=\"#proposition\">propositioner</a>, fÃ¶rslag och <a href=\"#redogorelse\">redogÃ¶relser</a>, <a href=\"#motion\">motioner</a>, <a href=\"#betankande\">utskottsbetÃ¤nkanden</a> samt <a href=\"#riksdagsskrivelse\">riksdagsskrivelser</a>.</p>\r\n<p class=\"gototoplink\"><a href=\"#\">GÃ¥ till sidans topp</a></p>\r\n<h2>Rskr<a name=\"R\"></a></h2>\r\n<p>Rskr. betyder <a href=\"#skrivelse\">skrivelse</a> frÃ¥n <a href=\"#riksdagen\">riksdagen</a> till <a href=\"#regeringen\">regeringen</a>.</p>\r\n<h2>RÃ…<a name=\"R\"></a></h2>\r\n<p>RÃ… Ã¤r en fÃ¶rkortning som kan stÃ¥ fÃ¶r bÃ¥de RiksÃ¥klagaren och <a href=\"#regeringsrattens_arsbok_ra\">RegeringsrÃ¤ttens Ã¥rsbok</a>.</p>\r\n<h2>RÃ¤ttsinformation<a name=\"R\"></a></h2>\r\n<p>RÃ¤ttsinformation Ã¤r ett samlingsbegrepp fÃ¶r alla dokument som Ã¤r ett resultat av <a href=\"#rattsprocessen\">rÃ¤ttsprocessens</a> steg. PÃ¥ lagrummet.se finns lÃ¤nkar till alla dessa dokument.</p>\r\n<p>RÃ¤ttsinformationen brukar delas i fyra olika huvudgrupper: fÃ¶rarbeten, fÃ¶rfattningar, rÃ¤ttspraxis och internationellt material.</p>\r\n<p>I gruppen <a href=\"#forarbeten\">fÃ¶rarbeten</a> ingÃ¥r</p>\r\n<ul>\r\n<li><a href=\"#regeringen\">regeringens</a> <a href=\"#kommittÃ©direktiv\">kommittÃ©direktiv</a></li>\r\n<li>regeringens utrednings<a href=\"#betankande\">betÃ¤nkanden</a> som publiceras i <a href=\"#departementsserien_ds\">Departementsserien (Ds)</a> och i <a href=\"#statens_offentliga_utredningar_sou\">Statens offentliga utredningar (SOU)</a></li>\r\n<li><a href=\"#forordningsmotiv\">fÃ¶rordningsmotiv</a></li>\r\n<li>regeringens <a href=\"#proposition\">propositioner</a> och <a href=\"#skrivelse\">skrivelser</a> till <a href=\"#riksdagen\">riksdagen</a></li>\r\n<li>regeringens <a href=\"#lagradsremiss\">lagrÃ¥dsremisser</a> till <a href=\"#lagradet\">LagrÃ¥det</a></li>\r\n<li>riksdagsledamÃ¶ternas <a href=\"#motion\">motioner</a></li>\r\n<li>riksdags<a href=\"#utskott\">utskottens</a> betÃ¤nkanden och <a href=\"#yttrande\">yttranden</a></li>\r\n<li>riksdagsmyndigheternas <a href=\"#framstallningar\">framstÃ¤llningar</a> och <a href=\"#redogorelse\">redogÃ¶relser</a></li>\r\n<li>riksdagens skrivelser</li>\r\n<li>riksdagens <a href=\"#protokoll\">protokoll</a></li>\r\n<li><a href=\"#lagradet\">LagrÃ¥dets</a> <a href=\"#yttrande\">yttranden</a>.</li>\r\n</ul>\r\n<p>I gruppen <a href=\"#forfattning\">fÃ¶rfattningar</a> ingÃ¥r</p>\r\n<ul>\r\n<li><a href=\"#grundlag\">grundlagar</a> och andra lagar som riksdagen har beslutat</li>\r\n<li><a href=\"#forordning\">fÃ¶rordningar</a> som regeringen har beslutat</li>\r\n<li><a href=\"#myndighetsforeskrift\">myndighetsfÃ¶reskrifter</a>.</li>\r\n</ul>\r\n<p>I gruppen <a href=\"#rattspraxis\">rÃ¤ttspraxis</a> ingÃ¥r</p>\r\n<ul>\r\n<li><a href=\"#vagledande_avgoranden\">vÃ¤gledande avgÃ¶randen</a> frÃ¥n hÃ¶gre domstolar</li>\r\n<li>vÃ¤gledande avgÃ¶randen frÃ¥n vissa myndigheter</li>\r\n<li>beslut om <a href=\"#fortursforklaring\">fÃ¶rtursfÃ¶rklaring</a> frÃ¥n domstolar.</li>\r\n</ul>\r\n<p>I gruppen internationellt material ingÃ¥r</p>\r\n<ul>\r\n<li><a href=\"#sveriges_internationella_overenskommelser_so\">Sveriges internationella Ã¶verenskommelser (SÃ–)</a>, till exempel avtal och konventioner</li>\r\n<li><a href=\"#eu-ratt\">EU-rÃ¤tt</a> (<a href=\"#fordrag\">fÃ¶rdrag</a>, <a href=\"#eu-forordning\">EU-fÃ¶rordningar</a> och <a href=\"#eu-direktiv\">EU-direktiv</a>)</li>\r\n<li>rÃ¤ttspraxis frÃ¥n <a href=\"#eu-domstolen_\">EU-domstolen</a> och <a href=\"#europadomstolen_\">Europadomstolen</a>.</li>\r\n</ul>\r\n<h2>RÃ¤ttspraxis<a name=\"R\"></a></h2>\r\n<p>RÃ¤ttspraxis Ã¤r tidigare domar frÃ¥n hÃ¶gre domstolar och vissa <a href=\"#myndighet\">myndigheter</a>. Om mÃ¥let har avgjorts i hÃ¶gsta instans Ã¤r rÃ¤ttsfallet vÃ¤gledande fÃ¶r rÃ¤ttstillÃ¤mpningen. Ett avgÃ¶rande som blir vÃ¤gledande kallas fÃ¶r prejudikat.</p>\r\n<p>En domstol ska alltid dÃ¶ma pÃ¥ samma sÃ¤tt i samma typ av mÃ¥l. Den som har rÃ¤ttat sig efter en domstols tolkning av <a href=\"#lag\">lagen</a> ska kunna kÃ¤nna sig sÃ¤ker pÃ¥ att domstolen dÃ¶mer pÃ¥ samma sÃ¤tt nÃ¤sta gÃ¥ng samma frÃ¥ga kommer upp. En underdomstol ska inte heller dÃ¶ma pÃ¥ ett sÃ¤tt som strider mot hur en Ã¶verordnad domstol tidigare har dÃ¶mt. Om det finns ett prejudikat i en viss frÃ¥ga ska en domstol dÃ¤rfÃ¶r anvÃ¤nda detta som komplement vid bedÃ¶mningen nÃ¤r den avgÃ¶r ett liknande mÃ¥l eller Ã¤rende. Denna fÃ¶rutsebarhet Ã¤r grundlÃ¤ggande fÃ¶r medborgarnas rÃ¤ttssÃ¤kerhet.</p>\r\n<p>I Sverige Ã¤r det i fÃ¶rsta hand domar frÃ¥n HÃ¶gsta domstolen och HÃ¶gsta fÃ¶rvaltningsdomstolen (tidigare RegeringsrÃ¤tten) som blir prejudikat, men Ã¤ven vissa domar frÃ¥n hovrÃ¤tter, kammarrÃ¤tter och specialdomstolar kan bli vÃ¤gledande.</p>\r\n<h2>RÃ¤ttsprocessen<a name=\"R\"></a></h2>\r\n<p>I rÃ¤ttsprocessen ingÃ¥r alla steg frÃ¥n att en frÃ¥ga vÃ¤cks och ett lagstiftningsÃ¤rende pÃ¥bÃ¶rjas, via de utredningar och beslut som fattas innan en ny <a href=\"#lag\">lag</a> bÃ¶rjar gÃ¤lla, till den <a href=\"#rattspraxis\">rÃ¤ttspraxis</a> som utvecklas hos domstolar och <a href=\"#myndighet\">myndigheter</a> nÃ¤r den nya lagen anvÃ¤nds.</p>\r\n<p class=\"gototoplink\"><a href=\"#\">GÃ¥ till sidans topp</a></p>\r\n<h2>SFS<a name=\"S\"></a></h2>\r\n<p>SFS Ã¤r en fÃ¶rkortning av <a href=\"#svensk_forfattningssamling_sfs\">Svensk fÃ¶rfattningssamling</a>.</p>\r\n<h2>SFS-registret<a name=\"S\"></a></h2>\r\n<p>SFS-registret Ã¤r ett register Ã¶ver de <a href=\"#lag\">lagar</a> och <a href=\"#forordning\">fÃ¶rordningar</a> som <a href=\"#kungorelse\">kungÃ¶rs</a> i <a href=\"#svensk_forfattningssamling_sfs\">Svensk fÃ¶rfattningssamling (SFS)</a>. FÃ¶rfattningar som inte gÃ¤ller lÃ¤ngre finns ocksÃ¥ med i registret.</p>\r\n<h2>Skr<a name=\"S\"></a></h2>\r\n<p>Skr. betyder <a href=\"#skrivelse\">skrivelse</a> frÃ¥n <a href=\"#regeringen\">regeringen</a> till <a href=\"#riksdagen\">riksdagen</a>.</p>\r\n<h2>Skrivelse<a name=\"S\"></a></h2>\r\n<p>Skrivelser kan komma frÃ¥n bÃ¥de <a href=\"#riksdagen\">riksdagen</a> och <a href=\"#regeringen\">regeringen</a>. En skrivelse frÃ¥n riksdagen Ã¤r ett meddelande till regeringen om vilka beslut som riksdagen har fattat, till exempel om att infÃ¶ra en ny <a href=\"#lag\">lag</a>. En riksdagsskrivelse brukar fÃ¶rkortas rskr. En skrivelse frÃ¥n regeringen innehÃ¥ller information inom ett visst omrÃ¥de till riksdagen. I motsats till en <a href=\"#proposition\">proposition</a> innehÃ¥ller en skrivelse frÃ¥n regeringen inget fÃ¶rslag till riksdagsbeslut. En skrivelse frÃ¥n regeringen brukar fÃ¶rkortas skr.</p>\r\n<p><a class=\"remotelink\" href=\"http://www.riksdagen.se/sv/Dokument-Lagar/Kammaren/Riksdagsskrivels