<a href=\"#myndighetsforeskrift\">myndighetsfÃ¶reskriften</a> genom att fÃ¶rtydliga begrepp eller genom att visa hur du kan eller bÃ¶r handla i en viss situation. AllmÃ¤nna rÃ¥d Ã¤r inte tvingande pÃ¥ samma sÃ¤tt som fÃ¶reskriften.</p>\r\n<h2 id=\"betankande\">BetÃ¤nkande<a name=\"B\"></a></h2>\r\n<div>\r\n<p>Begreppet betÃ¤nkande har tvÃ¥ betydelser:</p>\r\n<ul>\r\n<li>Ett betÃ¤nkande kan vara en rapport frÃ¥n nÃ¥got av <a href=\"#riksdagen\">riksdagens</a> <a href=\"#utskott\">utskott</a> med ett motiverat fÃ¶rslag till hur riksdagen ska besluta i ett Ã¤rende. Rapporten kallas dÃ¥ fÃ¶r ett utskottsbetÃ¤nkande.</li>\r\n<li>Ett betÃ¤nkande kan ocksÃ¥ vara en rapport med fÃ¶rslag frÃ¥n en sÃ¤rskild utredare eller <a href=\"#kommitte\">kommittÃ©</a> som <a href=\"#regeringen\">regeringen</a> har tillsatt. Rapporten kallas dÃ¥ fÃ¶r ett utredningsbetÃ¤nkande och publiceras i serien <a href=\"#Statens_offentliga_utredningar_SOU\">Statens offentliga utredningar (SOU)</a>.</li>\r\n</ul>\r\n<p><a class=\"remotelink\" href=\"http://www.riksdagen.se/sv/Dokument-Lagar/Utskottens-dokument/Betankanden/\">SÃ¶k bland riksdagens utskottsbetÃ¤nkanden</a><br /><a class=\"remotelink\" href=\"http://www.regeringen.se/sb/d/108\">SÃ¶k bland Statens offentliga utredningar (SOU)</a></p>\r\n</div>\r\n<h2>Budgetpropositionen<a name=\"B\"></a></h2>\r\n<div>\r\n<p>Budget<a href=\"#proposition\">propositionen</a> Ã¤r <a href=\"#regeringen\">regeringens</a> Ã¥rliga fÃ¶rslag till statsbudget. I propositionen ingÃ¥r en plan fÃ¶r statens finansiering och en redovisning av regeringens Ã¶vergripande mÃ¥l med budgeten. Propositionen innehÃ¥ller ocksÃ¥ berÃ¤kningar av statens utgifter och inkomster samt ett fÃ¶rslag till hur regeringen vill fÃ¶rdela pengar fÃ¶r olika Ã¤ndamÃ¥l.</p>\r\n<p>Regeringen lÃ¤mnar budgetpropositionen till <a href=\"#riksdagen\">riksdagen</a> senast den 20 september varje Ã¥r.</p>\r\n</div>\r\n<h2>Departementsserien (Ds)<a name=\"D\"></a></h2>\r\n<div>\r\n<p>NÃ¤r <a href=\"#reg