h Landstings webbplats</a>Â <br /><a class=\"remotelink\" href=\"http://www.domstol.se/templates/DV_Search.aspx?id=156&amp;tab=contact\">SÃ¶k domstol hos Sveriges Domstolar</a></p>\r\n<h3>AnmÃ¤l brister till ombudsmÃ¤nnen</h3>\r\n<p>Inom mÃ¥nga omrÃ¥den i samhÃ¤llet finns en ombudsman. Till ombudsmÃ¤nnen kan du vÃ¤nda dig nÃ¤r du vill klaga pÃ¥ nÃ¥got som du upplever Ã¤r fel. Till de flesta kan du ocksÃ¥ lÃ¤mna in en anmÃ¤lan om du kÃ¤nner dig diskriminerad.Â </p>\r\n<p><strong>Barnombudsmannen</strong> fÃ¶retrÃ¤der barns och ungas rÃ¤ttigheter och intressen med utgÃ¥ngspunkt i FN:s konvention om barnets rÃ¤ttigheter.<br /><a class=\"remotelink\" href=\"http://www.bo.se/\">Barnombudsmannen (BO)</a></p>\r\n<p><strong>Diskrimineringsombudsmannen (DO)</strong> arbetar mot diskriminering och fÃ¶r allas lika rÃ¤ttigheter och mÃ¶jligheter. Du kan anmÃ¤la till DO om du upplever att du har blivit diskriminerad pÃ¥ grund av till exempel kÃ¶n,Â etnisk tillhÃ¶righet, religion,Â funktionshinder, sexuell lÃ¤ggning, Ã¥lder ellerÂ om du har blivit missgynnad i samband med din fÃ¶rÃ¤ldraledighet.<br /><a class=\"remotelink\" href=\"http://www.do.se/\">Diskrimineringsombudsmannen (DO)</a></p>\r\n<p><strong>Konsumentombudsmannen (KO)</strong> driver konsumenternas intressen gentemot fÃ¶retag i domstol.<br /><a class=\"remotelink\" href=\"http://www.konsumentverket.se/omkonsumentverket/KO/\">Konsumentombudsmannen (KO)</a></p>\r\n<p><strong>JustitieombudsmÃ¤nnen (JO)</strong>Â â€”Â eller Riksdagens ombudsmÃ¤n som de officiellt kallasÂ â€” kontrollerar att myndigheterna och tjÃ¤nstemÃ¤nnen pÃ¥ myndigheterna fÃ¶ljer gÃ¤llande lagar och bestÃ¤mmelser. <br /><a class=\"remotelink\" href=\"http://www.jo.se/\">Riksdagens ombudsmÃ¤n (JO)</a></p>\r\n<p><strong>Europeiska ombudsmannen</strong> behandlar klagomÃ¥l om missfÃ¶rhÃ¥llanden i EU:s institutioner. <br /><a class=\"remotelink\" href=\"http://www.ombudsman.europa.eu/home/sv/default.htm\">Europeiska ombudsmannen</a></p>\r\n</div>\r\n</div